import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import Header from './components/Header';
import Home from './components/Home';
import ManageMovies from './components/ManageMovies';
import ManageUsers from './components/ManageUsers';
import ManageShoppeLinks from './components/ManageShoppeLinks';
import ManagePayments from './components/ManagePayments';
import './style.css';

function App() {
  return (
    <Router>
      <div className="app">
        <Header />
        <div className="main-content">
          <Sidebar />
          <div className="content">
            <Switch>
              <Route exact path="/" component={Home} />
              <Route path="/manage-movies" component={ManageMovies} />
              <Route path="/manage-users" component={ManageUsers} />
              <Route path="/manage-shoppe-links" component={ManageShoppeLinks} />
              <Route path="/manage-payments" component={ManagePayments} />
            </Switch>
          </div>
        </div>
      </div>
    </Router>
  );
}

export default App;
